import  { useState }  from 'react'

function App() {
const [infor , setUpdate ] = useState({
  name : 'Huy',
  age : '24',
  address : 'Suoi Nho'
})
const handleUpdate = () => {

      setUpdate({
        ...infor,
        Cv : 'Developer'
      })
}
  return (
    <div className="App">
       <h1>{JSON.stringify(infor)}</h1>
       <button onClick={handleUpdate}>Update</button>
    </div>
  );
}
export default App;
